import React from 'react';
import Sidebar from "./Sidebar";
import Community from "./Community";
import './output.css';

export default function Layout3({ user }) {
  return (
    <div className="flex">
      <Sidebar user={user} />
      <div className="flex-1" style={{ marginLeft: 300 }}>
        <Community />
      </div>
    </div>
  );
}
